import axios from 'axios'

export const resetUser = async (): Promise<Number> => {
    const updatedUser = await axios.post(`${process.env.REACT_APP_ENDPOINT}/API/updateUser`)
    const updatedUserFiatNumber: Number = updatedUser.data.fiat
    return updatedUserFiatNumber
}
